import React from 'react'
import { NavLink } from 'react-router-dom'

const Service =()=>{
    return(
        <>
        <h1>This page does't Exit</h1>
        <p>Service 404!</p>
        <NavLink className="bt" to="/">Go Back</NavLink>
        </>
    )
}
export default Service;
